import axios from "axios";
import './App.css';
import {useEffect, useState} from "react";

function App() {
    const [arr, setarr]=useState([]);
    const [loading, setloading]=useState(false);
    useEffect(()=>{
        setarr([]);
        setloading(false);
        async function a() {
            let res=await axios.get("https://api.music.msub.kr/?song=Life%20is%20Good")
            let data = res.data;
            setarr([
                data.lineup
            ]);
            setloading(true);
        }
        a()
    }, []);

    if(!loading) return null;
  return (
      <div>
          {arr[0]}
      </div>
  );
}

export default App;
